import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import FlourishLogo from "../assets/images/FLRSH_logo.svg";
import Asterisk from "../assets/images/FLRSH_Asterisk_Big.svg";

export default function Hero() {
  return (
    <section
      style={{ backgroundColor: "#392390", height: "700px" }}
      className="text-white py-5 mb-5"
      id="hero"
    >
      <Container className="pb-5">
        <Row className="pt-5 justify-content-center">
          <Col lg={{ span: 8, offset: 4 }} className="pt-5 mb-5">
            <img
              src={Asterisk}
              alt="FLRSH-Asterisk-Big"
              className="position-absolute"
              style={{ maxWidth: "60px" }}
            />
            <p className="main-title">
              Lorem ipsum dolor sit amet consectetur adipisicing elit. Illum
              minima aut velit labore quidem rerum quibusdam explicabo modi
              repellendus sit!
            </p>
          </Col>
        </Row>
        <Row>
          <Col lg={6}>
            <img src={FlourishLogo} alt="flourish-logo" />
          </Col>
        </Row>
      </Container>
    </section>
  );
}
